param.script:
# The editor to custom a script node.
# Do not modify provided codes below.
def script(**kwargs) -> dict[str, typing.Any]:
    # You can access the input data via kwargs dictionary.
    def gcd(x: typing.int, y: typing.int) -> typing.int:
        if y == 0:
            return x
        return gcd(y, x % y)

    x = kwargs['a']
    y = kwargs['b']
    if x == 0:
        x = 1
    if y == 0:
        y = 1

    result = gcd(x, y)

    # Prepare the output data as a dictionary.
    output_data = {
        'gcd': result,
    }

    return output_data
